function Register(props){
    return(
        <div>
            <h3>새로운 책 등록</h3>
            <form>
                <div>
                    <label>책 이름</label>
                    <input type={"text"}/>
                </div>

                <div>
                    <label>책 한줄 소개</label>
                    <input type="text"/>
                </div>
            </form>
        </div>
    );
}

export default Register;
